import React from "react";
import { Section, Column1, Column2, Button } from "../style/body";
import { useState, useEffect } from "react";
import axios from "axios";
import { TableMain } from "../style/table";
const Body = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    getresult();
  }, []);

  const getresult = () => {
    axios("https://fakestoreapi.com/products")
      .then((res) => setData(res.data))
      .catch((err) => console.log(err));
  };
  return (
    <div>
      <Section>
        <Column1>
          <Button onClick={getresult}>Get Api Data</Button>
        </Column1>

        <Column2>
          <TableMain>
            <thead>
              <tr>
                <th>Id</th>
                <th>title</th>
                <th>Category</th>
              </tr>
            </thead>
            <tbody>
              {data.map((row) => (
                <td>
                  <tr>{row.id}</tr>
                  <tr>{row.title}</tr>
                  <tr>{row.categoory}</tr>
                </td>
              ))}
            </tbody>
          </TableMain>
        </Column2>
      </Section>
    </div>
  );
};

export default Body;
